), 

AND(
OR(ISPICKVAL([CLQ_Program_Transaction__c].CLQ_Registration_Status__c,"Withdrawn by Provider"),
ISPICKVAL([CLQ_Program_Transaction__c].CLQ_Registration_Status__c,"Withdrawn"),
ISPICKVAL([CLQ_Program_Transaction__c].CLQ_Registration_Status__c,"Withdrawn at Applicant's Request")
), 
OR(
(([CLQ_Program_Transaction__c].RecordType.Name='Day Camp' || [CLQ_Program_Transaction__c].RecordType.Name='Registration - Out of State') && ISPICKVAL([CLQ_Program_Transaction__c].CLQ_Transaction_Type__c,"Registration")),
([CLQ_Program_Transaction__c].RecordType.Name='In-Home Aide' && ISPICKVAL([CLQ_Program_Transaction__c].CLQ_Transaction_Type__c,"Initial Application") )
)
)
)

